INSERT [dbo].[N003] ([ID_T], [DS_T], [KOD_T], [T_NAME], [DATEBEG], [DATEEND]) VALUES (176, N'C34', N'T2', N'Размер опухоли от 3 до 7 см, характеризуется опухоль признаками, которые перечислены ниже:
- вовлечение главного бронха, проксимальный край опухоли располагается не менее 2 см от  киля бифуркации трахеи (Carina trachealis) или сопровождающаяся ателектазом, но не всего лёгкого;
- опухоль любого размера, прорастающая в плевру;
- опухоль, которая сопровождается ателектазом или обструктивной пневмонией, распространяется на корень легкого, но при этом не поражает все легкое;', CAST(0xA93E0B00 AS Date), NULL)
INSERT [dbo].[N003] ([ID_T], [DS_T], [KOD_T], [T_NAME], [DATEBEG], [DATEEND]) VALUES (177, N'C34', N'T2a', N'Размер опухоли от 3 до 5 см', CAST(0xA93E0B00 AS Date), NULL)
INSERT [dbo].[N003] ([ID_T], [DS_T], [KOD_T], [T_NAME], [DATEBEG], [DATEEND]) VALUES (178, N'C34', N'T2b', N'Размер опухоли от 5 до 7 см', CAST(0xA93E0B00 AS Date), NULL)
INSERT [dbo].[N003] ([ID_T], [DS_T], [KOD_T], [T_NAME], [DATEBEG], [DATEEND]) VALUES (179, N'C34', N'T3', N'Размер опухоли превышает 7 см, либо опухоль может быть  любого размера, при этом переходит на:
- грудную стенку;
- диафрагму;
- диафрагмальный нерв;
- медиастинальную плевру;
- париетальный листок перикарда;
- может поражать главный бронх,
- распространяется менее чем на 2 см от карины
- обтурационный ателектаз или обструктивный пневмонит всего легкого.', CAST(0xA93E0B00 AS Date), NULL)
INSERT [dbo].[N003] ([ID_T], [DS_T], [KOD_T], [T_NAME], [DATEBEG], [DATEEND]) VALUES (180, N'C34', N'T4', N'Опухоль любого размера, распространяющаяся на средостение, сердце, крупные сосуды, трахею, возвратный нерв, пищевод, позвонки, карину, при этом могут появляться отдельные опухолевые очаги в другой доле на стороне поражения.', CAST(0xA93E0B00 AS Date), NULL)
